/** 
 * Constructs an SOA (start of authority) record.
 * @param primaryNameServer any name server that will respond authoritatively for the domain
 * @param responsiblePerson e-mail address of person responsible for this zone
 * @param serial a serial number that must be incremented when changes are made. Recommended format is YYYYMMDDnn. For example, if the primary name server is changed on June 19, 2013, then the serial would be 2013061901. If it is changed again on the same day it would be 2013061902
 * @param refreshTime number of seconds a secondary name server waits, after getting a copy of the zone, before it checks the zone again for changes
 * @param retryTime number of seconds to wait after a failed refresh attempt before another attempt to refresh is made
 * @param expireTime number of seconds secondary name server can hold information before it is considered not authoritative
 * @param minimumTtl number of seconds that records in the zone are valid for (if a record has a higher TTL, it overrides this value which is just a minimum)
 */
public StartOfAuthorityRecord(String primaryNameServer,String responsiblePerson,long serial,int refreshTime,int retryTime,int expireTime,long minimumTtl){
  this.primaryNameServer=primaryNameServer;
  this.responsiblePerson=responsiblePerson;
  this.serial=serial;
  this.refreshTime=refreshTime;
  this.retryTime=retryTime;
  this.expireTime=expireTime;
  this.minimumTtl=minimumTtl;
}
